import React from "react";
import { NavLink } from "react-router-dom";

const NavBar = () => {
  return (
    <div>
      <NavLink to="/"> hello</NavLink>
      <NavLink to="/view-user"> viewuser</NavLink>
    </div>
  );
};

export default NavBar;
